// Require in dependencies
import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <div className="bottom">
        Click-A-Dog Game! <img alt="react" src="assets/images/react.svg" />
      </div>
    </footer>
  );
}

// Export Footer
export default Footer;
